package com.cybersoft.stack.excersies;

public class Tab {

	private int index;
	private String name;
	
	public Tab() {
		// TODO Auto-generated constructor stub
	}

	public Tab(int index, String name) {
		this.index = index;
		this.name = name;
	}

	public int getIndex() {
		return index;
	}

	public void setIndex(int index) {
		this.index = index;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}
	
}
